import styled from "styled-components";
import React from 'react';

const textStyle = {
    textAlign: 'center', // <-- the magic
    fontWeight: 'bold',
    fontSize: 18,
    marginTop: 0,
    width: 200,
    color: 'blue',
  };

export default (props) => {
  return (
    <div>
      <h4 style = {textStyle}>{props.name}</h4>
    </div>
  );
}
